import { Link } from 'react-router-dom';


export default function LandingPage() {
  return (
    <div style={{ textAlign: 'center', padding: '40px' }}>
      <h1>Learnings in the Education Space</h1>import React from 'react';
import './LandingPage.css';
import logo from './logo.png'; 

export const LandingPage = () => (
  <div className="container">
    <header className="header">
      <img src={logo} alt="Logo" />
    </header>

    <main className="main">
      <p className="welcome">Welcome to Faculty Research Dashboard</p>
      <h1 className="title">Track, Manage, and Document Research Publications</h1>
      <p className="description">
        A centralized platform for faculty members and the Research & Development (R&D) cell to streamline research submissions, monitor publications, and manage academic outputs efficiently.
      </p>

      <div className="buttons">
        <a href="/faculty-login" className="login-btn">FACULTY LOGIN</a>
        <a href="/hod-login" className="login-btn">HEAD OF THE DEPARTMENT LOGIN</a>
        <a href="/login" className="login-btn">R&D ADMIN LOGIN</a>
        <a href="/principal-login" className="login-btn">PRINCIPAL LOGIN</a>
      </div>
    </main>
  </div>
);

      <p>Faculty Research Management System</p>
      <p>A centralized platform to manage, track, and evaluate faculty research publications and scholarly contributions at SVECW.</p>
      <Link to="/faculty-login">
        <button style={{ marginRight: '10px' }}>FACULTY LOGIN</button>
      </Link>
      <Link to="/admin-login">
        <button>R&D ADMIN LOGIN</button>
      </Link>
    </div>
  );
}
